import Link from 'next/link';

const linkStyle = {
    margingRight:15
};

const Header = () => (
    <div>
        <Link href='/'>
            <a style={linkStyle}>Home</a>
        </Link>
        <Link>
            <a style={linkStyle}>About</a>
        </Link>
    </div>
);

export default Header();
